import React, { useState } from "react";
import { StyleSheet } from "react-native";
import { Formik, Field } from "formik";
import CustomInput from "components/AuthForm/CustomInput";
import { View } from "react-native";
import { RadioButton, Card, Title, Text } from "react-native-paper";

const SelectAccountForm = () => {
  const [account, setAccount] = useState("");
  return (
    <Card.Content>
      <Title>Selectionner votre type de compte</Title>
      <RadioButton.Group
        onValueChange={(newValue) => setAccount(newValue)}
        value={account}
      >
        <View>
          <Text>First</Text>
          <RadioButton value="first" />
        </View>
        <View>
          <Text>Second</Text>
          <RadioButton value="second" />
        </View>
      </RadioButton.Group>
    </Card.Content>
  );
};

export default SelectAccountForm;
